@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:CashCard a owl:Class .
atm:Customer a owl:Class .

atm:ownsCard a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:dispensedTo a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Customer .

atm:loggedAmount a owl:DatatypeProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range xsd:decimal .

atm:loggedSerialNumber a owl:DatatypeProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range xsd:string .

atm:responseSent a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:dispensedMoney a owl:DatatypeProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range xsd:boolean .

atm:DispensedTransaction a owl:Class ;
    rdfs:subClassOf atm:ATM ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:dispensedMoney ;
                          owl:hasValue true ] .

atm:LoggedTransaction a owl:Class ;
    rdfs:subClassOf atm:ATM ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:loggedAmount ;
                          owl:someValuesFrom xsd:decimal ],
                        [ a owl:Restriction ;
                          owl:onProperty atm:loggedSerialNumber ;
                          owl:someValuesFrom xsd:string ] .

atm:ResponseSentTransaction a owl:Class ;
    rdfs:subClassOf atm:ATM ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:responseSent ;
                          owl:someValuesFrom atm:Bank ] .

atm:Transaction a owl:Class ;
    owl:equivalentClass [ a owl:Class ;
                          owl:unionOf (atm:DispensedTransaction atm:LoggedTransaction atm:ResponseSentTransaction) ] .
